description:
Starstruck (2010)  

Verenigde Staten
Muziek
90 minuten

geregisseerd door Michael Grossman
met Sterling Knight, Danielle Campbell en Brandon Smith

Jessica Olsen gaat naar Los Angeles om haar grootmoeder te bezoeken, terwijl haar zus de jonge popster Christopher Wilde probeert te ontmoeten. Op een avond ontmoet Jessica Christopher. Samen beleven ze een avontuur en beginnen ze elkaar steeds leuker te vinden. Maar als Jessica thuis komt, zegt Christopher op de televisie dat hij Jessica niet kent.

